//グローバル変数
let NUM_ITEM = 131;   //曲の数
let mat;              //matchのコピー
let index;            //曲のインデックス
let master_flag = false;  //自分が親なら1

//仕方のないグローバル変数たち
let tester;
let time;
let talk_id;
let receive_song;

function init(){        //matを初期化
    mat = match;
    return;
}

function flag(item){    //もう提示したitemとの一致度は2に更新
    for(let i = 0; i < NUM_ITEM; i++){
        mat[i][item] = 2;
    }
    return;
}

function sort_index(array){ //昇順にソートした時のインデックスの配列を返す
    return Array.from(Array(array.length).keys()).sort((a, b) => array[a] < array[b] ? -1 : (array[b] < array[a]) | 0);
}

function select_min5(item){
    let c = 0;   //一致度が2以外の曲の数
    for(let i = 0; i < NUM_ITEM; i++){
        if(mat[item][i] !== 2){
            c++;
        }
    }
    if(c > 5){
        c = 5;
    }
    mins_index_sorted = sort_index(mat[item])
    if(c >= 1){
        return mins_index_sorted[Math.floor(Math.random() * c)];
    }else{
        return 0; //あまり良くないけど
    }
}

function Time(){
  let dt = new Date();
  let time = dt.getHours() + ":" + dt.getMinutes() + ":" + dt.getSeconds(); 
  return time;
};

function changeColor(idname){
  var obj = document.getElementById(idname);
  obj.style.color = "red";            //文字色を赤にする
  //obj.style.backgroundColor = '#ff0000';  //背景色を赤にする
}

$(document).ready(function(){
  //会話ID送信ボタンが押されたら
  $("#submit_button").on("click", function() {
    talk_id = $("#talk_id").val();  //会話IDを取得
    $("#rooms").hide();
    sentence.innerHTML = "あなたの名前を選んでください。";
    $("#name_buttons, #leave_room").show();

    // 受信処理（子でも親でも）
    database.ref(talk_id + "/change_song").on("child_added", function(data) {
      database.ref(talk_id + "/answer_added_flag").once("value", function(snap) {
        if(snap.numChildren() === 0){ //1曲目
          $("#start").hide();  
          $("#song_name, #partner_yes, #partner_no, #myself_yes, #myself_no").show();
          sentence.innerHTML = "この曲名を見て、個人的ノスタルジアが喚起されますか？";
          const v = data.val();
          const k = data.key;
          receive_song = v.song;  //次に提示される曲が入る
          $("#song_name").html(v.song);
        }else{  //2曲目以降
          database.ref(talk_id + "/" + receive_song).once("value", function(snap2) {
            const data = snap2.val();
            for(let key in data){
              if(data[key].name !== tester){
                if(data[key].answer === true){
                  $("#partner_yes").css("background","salmon");
                }else{
                  $("#partner_no").css("background","salmon");
                }
              }
            }
          });
          let receive = function(){
            const v = data.val();
            const k = data.key;
            receive_song = v.song;  //次に提示される曲が入る
            $("#song_name").html(v.song);
            $('#myself_yes, #myself_no').prop('disabled',false);
            $("#partner_yes, #partner_no, #myself_yes, #myself_no").css("background","white");
          }
          setTimeout(receive, 1000);
        }
      });
    });

    //回答が追加されたら
    database.ref(talk_id + "/answer_added_flag").on("child_added", function(data) {
      database.ref(talk_id + "/" + receive_song).once("value", function(snap) {
        if(snap.numChildren() === 2){   //回答が2つ揃ったら
          const data = snap.val();
          let judge = true;
          for(let key in data){
            judge = judge && data[key].answer;
          }
          if(judge){  //両者とも懐かしいと感じた場合 
            sentence.innerHTML = "この曲は、二人とも個人的ノスタルジアが喚起される曲です。";
            $("#partner_yes").css("background","salmon");
            changeColor("sentence");
            time = Time();
            database.ref(talk_id + "/nostalgia_song").push({
              name: tester,
              song: songs[index],
              time: time,
            });
          }else{    //両者とも懐かしいと感じていない場合
            if(master_flag){  //自分が親だったら
              index = select_min5(index);
              flag(index);
              time = Time();
              database.ref(talk_id + "/change_song").push({
                name: tester,
                song: songs[index],
                time: time,
              });
            }
          }
        }
      });
    });

    //名前ボタンが押されたら
    $(".tester").on("click", function() {
      $("#name_buttons").hide();
      tester = $(this).data("name");  //名前データ取得
      $("#start").show();
      sentence.innerHTML = "どちらかがスタートボタンを押したら始まります。";
    });
  });

  //スタートボタンが押されたら（親になる）
  $("#start").on("click", function() {
    init(mat);
    index = Math.floor(Math.random() * NUM_ITEM);
    flag(index);
    receive_song = songs[index];
    time = Time();
    database.ref(talk_id + "/change_song").push({
      name: tester,
      song: songs[index],
      time: time,
    });
    database.ref(talk_id + "/answer_added_flag").push({
      name: "first",
      song: songs[index],
    });
    master_flag = true;
  });

  //退出ボタンが押されたら
  $("#leave_room").on("click", function() {
    location.reload();
  });

  //はい（自分）ボタンが押されたら
  $("#myself_yes").on("click", function() {
    $('#myself_yes, #myself_no').prop('disabled',true);
    $("#myself_yes").css("background","salmon");
    time = Time();
    database.ref(talk_id + "/answer_added_flag").push({
      name: "yes",
    });
    database.ref(talk_id + "/" + receive_song).push({
      name: tester,
      song: receive_song,
      answer: true,
      time: time,
    });
  });

  //いいえ（自分）ボタンが押されたら
  $("#myself_no").on("click", function() {
    $('#myself_yes, #myself_no').prop('disabled',true);
    $("#myself_no").css("background","salmon");
    time = Time();
    database.ref(talk_id + "/answer_added_flag").push({
      name: "no",
    });
    database.ref(talk_id + "/" + receive_song).push({
      name: tester,
      song: receive_song,
      answer: false,
      time: time,
    });
  }); 
});

